// Cash.js

import React, { useEffect, useState } from "react";
import {
  FaMoneyBillWave,
  FaChartLine,
  FaCashRegister,
  FaPercentage,
  FaChartPie,
} from "react-icons/fa";
import { getCash } from "../api/CashApi";
import { performAnalysis } from "../analysis/AnalysisGet";

const Cash = () => {
  const [cashData, setCashData] = useState(null);
  const [analysisData, setAnalysisData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        // Fetch cash data and perform analysis
        const cash = await getCash();
        const analysis = await performAnalysis();

        // Set state with fetched data
        setCashData(cash);
        setAnalysisData(analysis);
      } catch (error) {
        setError("Error fetching data");
        console.error("Error fetching data:", error);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  if (loading) return <p>Loading...</p>;
  if (error) return <p>{error}</p>;

  // Calculate Net P/L and Cash Balance if data is available
  const netPL = analysisData?.totalNetPL || 0;
  const cashBalance = (cashData?.initial_cash || 0) + netPL;

  return (
    <div className="cash-container">
      <div className="cash-card-container">
        {/* Initial Cash Card */}
        <div className="cash-card">
          <div className="card-content">
            <FaCashRegister className="card-icon" />
            <span className="label">Initial Cash:</span>
            <span className="value">
              {loading
                ? "Loading..."
                : error
                ? "Fund Account"
                : `$${cashData?.initial_cash || "Fund Account"}`}
            </span>
          </div>
        </div>

        {/* Available Cash Card */}
        <div className="cash-card">
          <div className="card-content">
            <FaChartPie className="card-icon" />
            <span className="label">Available Cash:</span>
            <span className="value">
              {loading
                ? "Loading..."
                : error
                ? "N/A"
                : `$${cashData?.available_cash || "N/A"}`}
            </span>
          </div>
        </div>

        {/* Net P/L Card */}
        <div className="cash-card">
          <div className="card-content">
            <FaChartLine className="card-icon" />
            <span className="label">Net P/L:</span>
            <span className="value">
              {loading ? "Loading..." : error ? "N/A" : `$${netPL}`}
            </span>
          </div>
        </div>

        {/* Cash Balance Card */}
        <div className="cash-card">
          <div className="card-content">
            <FaMoneyBillWave className="card-icon" />
            <span className="label">Cash Balance:</span>
            <span className="value">
              {loading ? "Loading..." : error ? "N/A" : `$${cashBalance}`}
            </span>
          </div>
        </div>

        {/* RoI Card */}
        <div className="cash-card">
          <div className="card-content">
            <FaPercentage className="card-icon" />
            <span className="label">RoI:</span>
            <span className="value">
              {loading
                ? "Loading..."
                : error
                ? "N/A"
                : `${analysisData?.totalROI || "N/A"}%`}
            </span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Cash;
